import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import AddCovidForm from "../components/AddCovidForm";
import Footer from "../components/Footer";
import Indonesia from "../components/Indonesia";


function Main() {
  return (
    <main>
      <Hero />
      <Indonesia />
      <Provinsi />
      <AddCovidForm />
    </main>
  );
}

function Home() {
  return (
    <>
      <Navbar />
      <Main />
      <Footer />
    </>
  );
}

export default Home;
